import React from 'react';
import helpers from '../../helpers/helper';

  const AdminDashboard = () =>  {
	const user = localStorage.getItem('user');
	return (
	  <div>
		welcome {helpers.decryption(user)?.name}
	  </div>
	);
  }

  export default AdminDashboard;
